import searchIconGray from '../../../img/icons/searchIconGray.svg'

import './search.scss'

const Search = () => {
    return(
        <div className="search">
            <div className="search-icon">
                <img src={searchIconGray} alt="search" />
            </div>
            <input className="search-input" type="text" />
        </div>
    )
}

export default Search
